import React, { useEffect, useState } from "react";
import axios from "axios";
import {Line} from 'react-chartjs-2'

const API_URL = "https://covid-api.mmediagroup.fr/v1/history?country=Australia&status=confirmed";


const CovidChart = () => {
    const [data, setData] = useState(null);
    useEffect(() => {
        axios.get(API_URL).then(res => setData(res.data["New South Wales"].dates));
    }, []);
    if (data != null) {
      var labels = Object.keys(data).slice(0,15);
      var covidData = Object.values(data).slice(0,15);
      covidData.slice(0, 15);
    }
    return (
      <div>
        <Line
          data={{
            labels: labels,
            datasets: [
              {
                label: "Daily",
                data: covidData,
                fill: false,
                borderColor: "rgb(75,192,192)",
                tension: 0.1,
              },
            ],
          }}
        />
      </div>
    );
}

export default CovidChart;
